import {makePostHelper} from "../javascript/Server"

const Expect = (func,obj) =>  {
    try {
        func(obj)
    } catch (exception) {
        return exception
    }
}

const testMakePost = () => {
    const flawPostObj = {
        author : "Wonjae Lee"
    }

   Expect(makePostHelper, "testPosts", flawPostObj)
}

export const runTests = () => {
    testMakePost();
}
